import React from 'react';
import Map from '../components/Map/Map';

function HomePage() {
  return (
    <div className="home-page">
      <h1>Welcome to GPS Fleet Management</h1>
      <p>This is the home page of our application.</p>
      <Map />
    </div>
  );
}

export default HomePage;
